versine_distance <- function(lat1, lon1, lat2, lon2) {\n  R <- 6371  # Earth radius in kilometers\n  \n  # Convert latitude and longitude from degrees to radians\n  lat1_rad <- radians(lat1)\n  lon1_rad <- radians(lon1)\n  lat2_rad <- radians(lat2)\n  lon2_rad <- radians(lon2)\n  \n  # Calculate differences in latitude and longitude\n  dlat <- lat2_rad - lat1_rad\n  dlon <- lon2_rad - lon1_rad\n  \n  # Haversine formula\n  a <- sin(dlat/2)^2 + cos(lat1_rad) * cos(lat2_rad) * sin(dlon/2)^2\n  c <- 2 * atan2(sqrt(a), sqrt(1-a))\n  distance <- R * c\n  \n  return(distance)\n}\n\n# Function to convert degrees to radians\nradians <- function(degrees) {\n  return(degrees * pi / 180)\n}\n\n# Example usage with your data\nlat1 <- 41.9665\nlon1 <- -87.6884\nlat2 <- 41.9671\nlon2 <- -87.6674\n\ndistance <- haversine_distance(lat1, lon1, lat2, lon2)\ncat(\"Haversine Distance:\", distance, \"km\\n\")","metadata":{"execution":{"iopub.status.busy":"2024-05-18T12:29:09.316065Z","iopub.execute_input":"2024-05-18T12:29:09.317974Z","iopub.status.idle":"2024-05-18T12:29:09.379090Z"},"trusted":true},"execution_count":64,"outputs":[{"name":"stdout","text":"Haversine Distance: 1.737499 km\n","output_type":"stream"}]},{"cell_type":"code","source":"data_2020$distance <- haversine_distance(data_2020$start_lat, data_2020$start_lng, data_2020$end_lat, data_2020$end_lng)","metadata":{"execution":{"iopub.status.busy":"2024-05-18T12:29:09.382517Z","iopub.execute_input":"2024-05-18T12:29:09.384363Z","iopub.status.idle":"2024-05-18T12:29:12.110076Z"},"trusted":true},"execution_count":65,"outputs":[]},{"cell_type":"code","source":"head(data_2020)","metadata":{"execution":{"iopub.status.busy":"2024-05-18T12:29:12.113463Z","iopub.execute_input":"2024-05-18T12:29:12.115778Z","iopub.status.idle":"2024-05-18T12:29:12.161525Z"},"trusted":true},"execution_count":66,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 6 × 17</caption>\n<thead>\n\